import React, { Component } from 'react';
import Slider from "react-slick";


class HeroCarousel extends Component {

    render() {
        var settings = {
            dots: false,
            infinite: true,
            slidesToShow: 1,
            slidesToScroll: 1,

            fade: true,
            speed: 500,
            autoplay: true,
            autoplaySpeed: 2000,
            cssEase: "linear"
        };
        return (
            <Slider {...settings}>
                <div >
                    <video
                        id="mainVideo"
                        src="https://ernesto-perez.com/wp-content/uploads/2019/08/video.mp4"
                        autoPlay
                        loop
                        type="video/mp4">
                    </video>
                </div>
                <div>
                    <div id="picture2" className="flexslider-hero-picture2">
                        <img src="assets/images/eram_02.jpg" />
                    </div>
                </div>
                <div>
                    <div id="picture4" className="flexslider-hero-picture4">
                        <img src="assets/images/eram_04.jpg" />
                    </div>
                </div>
            </Slider>
        );
    }
}

export default HeroCarousel;
